import React, {useState} from 'react'
import Base from "../core/Base.js"
import { Link, Redirect } from "react-router-dom"

import {signin, authenticate ,isAuthenticated} from "../auth/helper"
const SignIn = () =>{

    const Signin = () =>{

        const[values, setValues] = useState({
            email : "",
            password: "",
            error: "",
            loading: false,
            didRedirect: false

        })

    }

    const signInform = () =>{
        return (
            <div className="row" >
                <div className="col-md-7 offset-sm-3 text-left" >
                    <form>
                        <div className="form-group">
                            <label className="text-light">Email</label>
                            <input placeholder="Enter Email" className="form-control" type="email"></input>

                        </div>
                        <div className="form-group">
                            <label className="text-light">Password</label>
                            <input placeholder="Enter Password" className="form-control" type="password"></input>
                        </div>
                        <button className="btn btn-success btn-block">Submit</button>
                    </form>
                </div>
            </div>
        )
    }


    return (
        <Base  title="Signin Page" description="Page for user To sign In">
            {signInform()}
        </Base>
    )
} 
export default SignIn;
